import React from "react";
import { Tabs, Tab } from "react-mdl";

class SignUpIn extends React.Component {
  constructor(props) {
    super(props);
    this.state = { activeTab: 0 };
    this.html = (
      <div className="content">
        <div className="sign-in">
          <h2> Welcome Back!</h2>
          <div className="sign-in-form">
            <form>
              <label> Email:</label>
              <br />
              <input type="text" />
              <br />
              <label> Password:</label>
              <br />
              <input type="text" />
              <br />
              <input type="submit" />
            </form>
          </div>
        </div>
      </div>
    );
  }

  handleTabChange = (event) => {
    console.log(event);
    if (event === 0) {
      console.log("this is sign up");

      return <p> Sign Up</p>;
      //   return (
      //     <div className="content">
      //       <div className="sign-in">
      //         <h2> Welcome Back!</h2>
      //         <div className="sign-in-form">
      //           <form>
      //             <label> Email:</label>
      //             <br />
      //             <input type="text" />
      //             <br />
      //             <label> Password:</label>
      //             <br />
      //             <input type="text" />
      //             <br />
      //             <input type="submit" />
      //           </form>
      //         </div>
      //       </div>
      //     </div>
      //   );
    } else if (event === 1) {
      console.log("this is sign in");
      return <p> Hi!</p>;
    }
  };

  render() {
    return (
      <div className="demo-tabs">
        <Tabs
          activeTab={this.state.activeTab}
          onChange={(tabId) => this.setState({ activeTab: tabId })}
          ripple
          onChange={(tabId) => this.handleTabChange(tabId)}
        >
          <Tab>Sign Up</Tab>
          <Tab>Sign In</Tab>
        </Tabs>
        <section>
          <div>{this.html}</div>
        </section>
      </div>
    );
  }
}

export default SignUpIn;
